(2, 'Privacy Policy', 'privacy-policy', '<p><strong>OneUp Privacy Policy</strong></p>\r\n\r\n<p><strong>OneUp takes data protection seriously and respects your privacy. In this overview we inform you about which data we collect within the scope of our online offer and how we process this data in a simple and understandable way.</strong></p>\r\n\r\n<p><strong>Which data do we collect from you?</strong></p>\r\n\r\n<p>We collect the following data to provide our services on the website:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Data collection</strong></p>\r\n\r\n<p>User name, e-mail address, phone number, verifiable physical address, IP address, bank account details, and Government-issued identity card.</p>\r\n\r\n<p>We collect this data within the framework of legal regulations and process it for mutual, proper contract fulfilment. We also collect this data to administer your account, improve our services, for fraud prevention and misuse detection.</p>\r\n\r\n<p>As far as we are legally obliged, your data will be kept confidential unless requested by an appropriate authority for legitimate enquiries. In the event that we wish to process or use your personal data for other purposes and there is no legal permission to do so, we will ask for your consent in advance.</p>\r\n\r\n<p><strong>Cookies and website optimization</strong></p>\r\n\r\n<p>In order to provide our services to your full satisfaction, we use cookies and tracking services to create anonymous or pseudonymous user profiles. The evaluation is carried out in such a way that it is not possible to draw conclusions about you as the user. This data is only stored temporarily until evaluation and then permanently deleted.</p>\r\n\r\n<p>You can object to the creation of the user profiles at any time. Furthermore, you can set your browser so that no cookies are stored, or they are deleted at the end of the internet session. Please note, however, that in this case you may not be able to use all the functions of our mobile site.</p>\r\n\r\n<p><strong>How do we collect the data?</strong></p>\r\n\r\n<p>The data is collected either automatically when you visit the website or use our services, or through your own entries on our website or by use of cookies and pixels.</p>\r\n\r\n<p><strong>How do we protect your data?</strong></p>\r\n\r\n<p>Your data is protected against access by unauthorised third parties, misuse and loss through various measures using best-of-class security techniques such as SSL encryption and cryptography.</p>\r\n\r\n<p><strong>When will my data be deleted?</strong></p>\r\n\r\n<p>We store your data only as long as it is necessary to fulfil the above-mentioned purposes or until you object to the data processing. Subsequently, the data is deleted or blocked if the deletion is contrary to legal regulations or justified interests.</p>\r\n\r\n<p><strong>What are your rights?</strong></p>\r\n\r\n<p>You are entitled to request for your data stored with us as well as a right to request the correction, deletion or blocking of data, and objection and data portability at any time. Please contact&nbsp;<a href=\"mailto:users@oneup.ng\">users@oneup.ng</a>&nbsp;regarding your rights in relation to your personal data, or if you have any enquiries relating to our services.</p>\r\n', '1', '2018-07-17 00:00:00', '2018-07-17 04:31:02'),
(3, 'FAQ', 'faq', '<p>Welcome to the OneUp information hub. If you have a question about anything on the service, you are in the right place!</p>\r\n\r\n<p><strong>Q:</strong> <strong>How do I purchase tokens?</strong></p>\r\n\r\n<p>A: You can pay for tokens using your debit card. Visit the &lsquo;funds management section&rsquo; to select a token pack that works for you and pay for it using our secure payment gateway providers.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: How long will it take for purchased tokens to be added to my wallet?</strong></p>\r\n\r\n<p>A: Purchased tokens will be available in your wallet as soon as purchase is confirmed. This typically takes under 30 seconds. If you experience any delays, refresh your browser or restart the app.</p>\r\n\r\n<p>In the unlikely event you experience a delay and decide to contact Customer Support, please send us details relevant to your account and purchase to allow us assist you with your enquiry promptly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: Are tokens transferrable on OneUp?</strong></p>\r\n\r\n<p>A: Users cannot send tokens directly. The only way to increase your token haul outside buying is to win wager games against other users.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: Why does the payment gateway take me out of the app when I am trying to buy tokens?</strong></p>\r\n\r\n<p><a name=\"_GoBack\"></a> A: No harm done! The gateway processes the transaction securely and your tokens will be delivered to you on time, every time. We are working hard to ensure that the token purchase process is kept within the app, and this will be completed very soon.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: How long will it take for proceeds from sale of tokens to be sent to my bank account?</strong></p>\r\n\r\n<p>A: After your request to cash out is confirmed, the funds will be available in your designated bank account in under 24 hours.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: How do I save my progress? </strong></p>\r\n\r\n<p>A: You can synchronize your progress on the app and the mobile site by signing in with the same login information on all your devices.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: If I re-install the game, will I lose my progress or tokens?</strong></p>\r\n\r\n<p>A: No, you don&rsquo;t! As long as you log into the platform with a functional email account or you link your Facebook account to your profile, your progress will be restored when you re-install the app or log into the web platform after a period of absence.</p>\r\n\r\n<p><br />\r\n<strong>Q: What are the benefits of playing Practice or Friendly mode?</strong></p>\r\n\r\n<p>A: Both modes are to enable you test your skills against the game AI, or human opposition without having to stake tokens. Essentially training modes that prepare you for the serious business of winning tokens in Wager Mode.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Q: Why do I need to provide my bank information?</strong></p>\r\n\r\n<p>A: Your bank information is required for the transfer of funds to you when you decide to cash out tokens in your wallet. Without this, we are unable to send your money to you.</p>\r\n', '1', '2018-07-17 00:00:00', '2018-07-17 04:31:26'),
(4, 'Terms & Conditions', 'terms', '<p>These Terms and Conditions shall regulate the use of www.oneup.com.ng and www.oneup.ng and the OneUp Mobile App (collectively referred to as the &ldquo;Service&rdquo;) by any individual, company, or other organisation (User). It also regulates all the content sent and uploaded by Users within the scope of the features offered on the Service including e-mails, and chat messages service.</p>\r\n\r\n<p>The Service is a skill-based gaming platform, which offers Users the ability to play and place wagers against each other on several interactive mobile games. Users compete against each other using OneUp Tokens (Tokens), which can be converted to real money. Additional details on the games that are available to play, their rules, and further information about gameplay are provided on the Service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h1>General Terms</h1>\r\n	</li>\r\n	<li>\r\n	<h2>Types of Use</h2>\r\n\r\n	<p>OneUp distinguishes between Casual Players and Money Players. Casual Players typically play games on the &lsquo;Practice&rsquo;, and &lsquo;Friendly Modes&rsquo;, while Money Players participate by staking Tokens in the &lsquo;Wager Mode&rsquo; and include any Users who deposit, play with, or withdraw real money using the Service.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<h2>Registration</h2>\r\n\r\n	<p>Registration of Users on the Service is free, but OneUp reserves the right to reject the registration of Users without specifying any reason for rejection. Once registered, Users will operate User Accounts. The use of the features provided by the Service requires User registration.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Usernames</h2>\r\n\r\n	<p>Usernames shall not (i) be imitative of e-mail addresses or Internet Services; (ii) infringe upon the rights of third parties; (iii) violate any rules of good conduct. No User is entitled to a particular password or username.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Passwords</h2>\r\n\r\n	<p>For security reasons, passwords must differ from usernames, be kept secret and changed whenever a User deems necessary. Passwords should not be a sequence of consecutive numbers or letters, such as &ldquo;0123456789&rdquo; or &ldquo;ABCDEFG&rdquo;. More explicitly, a secure password should contain a combination of numbers, letters and at least one (1) special character.</p>\r\n\r\n	<p>OneUp shall not be responsible if a third party gains access to the account of a User who is in violation of these security guidelines. OneUp will not give your password to any third parties unless required to do so by law. OneUp will never ask Users for their passwords via telephone or E-mail. Oneup can only use the password request form on the login page of the Service to request a password.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Multiple Registrations</h2>\r\n\r\n	<p>Multiple registrations, as well as the setting up and operation of multiple accounts on the Service are prohibited. User Accounts are non-transferable.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Extent of Use</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Requirements for Use</h2>\r\n\r\n		<p>The use of the Service and Services are dependant upon certain conditions such as proof of payment, amount of completed games, and specific game rules amongst others.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Limitations of Use</h2>\r\n\r\n		<p>A User&#39;s entitlement to use of the Services are solely dependant upon the current technical status at OneUp. Temporary disturbances may be experienced due to the interruption of telecommunications, power outages, hardware and software failures amongst other things.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Hardware /Software /Connections</h2>\r\n\r\n		<p>Users are solely responsible to ensure that their hardware, software, and internet connections are current and meet necessary system requirements.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Maintenance Periods</h2>\r\n\r\n		<p>Maintenance work is conducted mainly for the purpose of ensuring the server&#39;s security and integrity. If possible, OneUp will notify users of maintenance periods in advance. A portion, or sometimes all, of the features of the Service will be unavailable during maintenance periods.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>Data Entry and Privacy Policy Notes</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Data Entry</h2>\r\n\r\n		<p>The personal information that OneUp requests from a User upon registration is to be fully and accurately completed, including a valid E-mail address, username, password, first and last name, date of birth, verifiable physical address (not postal box), bank information including bank verification number (when applicable), mobile phone number, as well as data from the User&rsquo;s National Identity Card such as an international Passport, Driver&rsquo;s Licence and Voter&rsquo;s Card (ID Card) when applicable. Age verification can be automatically carried out upon completion of registration based on the information entered. Please take note that OneUp reserves the right to end a User&#39;s registration on the Service, withhold any in-game currency or real money or cancel any account withdrawal in the event that false data is entered. If a User does not inform OneUp of changes in his personal information, then OneUp will continue to use the latest information available and the User will indemnify OneUp for any losses it suffers arising from its use.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Modifying Personal Data</h2>\r\n\r\n		<p>If a User&#39;s personal data changes after registration, he must immediately update, change, or notify OneUp of the changes. These changes can be updated in the relevant sections of the Service.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Privacy Policy</h2>\r\n\r\n		<p>We hold data protection guidelines with the utmost respect. OneUp only collects, processes, and uses personal data for which it has been granted legal permission and is necessary for regulatory and billing purposes. The use of your personal data shall take place as often as is required to facilitate the administration of the Service and enable you to play the games amongst other things.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Revocation of Consent</h2>\r\n\r\n		<p>In the event that we wish to use or process your personal data for any purpose for which we do not possess a legal permit, then we will acquire your consent, which you can issue via electronic means. When this method is used, we will inform you within the scope of the Services. Users are always free to revoke their consent to future use of their personal data. To do so, please send an E-mail to&nbsp;users@oneup.ng.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Cookies and Analysis Mechanisms</h2>\r\n\r\n		<p>To perform the Services to a standard that meets full customer satisfaction, we will utilize cookies and other mechanisms that enable us to analyse user behaviour. This will be done anonymously using techniques that present no possible means of tracing the collected data back to the user from which it was derived. This data will be used to analyse and optimize the Services. The data will be temporarily saved until an anonymous analysis has been compiled. Afterwards, the collected data will be permanently deleted.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Pseudonym-Based User Profiles</h2>\r\n\r\n		<p>Unless you revoke your consent, we are permitted to use your usage data for advertising, market research, and as seen fit to create user profiles under a pseudonym-based username within the scope of our services offered. If you wish for your usage data not to be used in such a manner, then please send an E-mail to&nbsp;users@oneup.ng</p>\r\n		</li>\r\n		<li>\r\n		<h2>Security Standards</h2>\r\n\r\n		<p>OneUp will use security measures and mechanisms (such as SSL encryption, cryptography), chosen in regard to present technological capabilities, in order to offer our services in a form, which is secured as best possible against access and manipulation by third-parties.</p>\r\n\r\n		<p>You may use our services via a pseudonym-based username provided that such pseudonym is to preserve your anonymity to other users of the Service only and does not prevent or hinder us from knowing your identity in accordance with these terms.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Disclosure</h2>\r\n\r\n		<p>If you have any questions regarding our use of your personal data, then we would be pleased to provide more detailed information upon contacting our customer service, or emailing us via users@oneup.ng.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>Cancellation / Contract Duration and Termination</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>User&#39;s Right to Termination</h2>\r\n\r\n		<p>A User can terminate his user license agreement at any time by sending an E-mail to users@oneup.ng. The remaining valid Tokens on the User&#39;s account will be transferred to their bank account within a processing period of less than three (3) business days.</p>\r\n		</li>\r\n		<li>\r\n		<h2>OneUp&#39;s Right to Termination</h2>\r\n\r\n		<p>OneUp retains the right to terminate and deactivate a User&rsquo;s Account for any reason whatsoever.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>Liability and Corrective Action for Money Games</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Limitation of Liability</h2>\r\n\r\n		<p>OneUp cannot be held liable, under any circumstances, for any losses or damage of any kind incurred by a User, or any other person or entity, directly or indirectly as a result of any content included or omitted on the Service, or as a result of any abuse on the User by another User.</p>\r\n\r\n		<p>The User agrees not to hold the OneUp liable, under any circumstances, for any losses or damage of any kind incurred by the User, or any other person or entity, directly or indirectly as a result of using or misusing the Service.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Errors</h2>\r\n\r\n		<p>OneUp is not liable for errors in data entry, transmission, and/or scores, as OneUp has no influence over these problems.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Erroneous Data Entry</h2>\r\n\r\n		<p>OneUp reserves the right to retroactively amend obvious errors in the specification of entry fees, prices, quotes amongst other things.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Premature Closing</h2>\r\n\r\n		<p>If OneUp is forced to end an ongoing wager game prematurely, then the participating Users can have the full value of their Tokens staked on the game refunded and credited to their respective accounts. OneUp is not liable for any collateral or consequential damages.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Prizes</h2>\r\n\r\n		<p>OneUp is not liable for lost winnings or potential winnings, not even in the case of prematurely closed wager matches or tournaments.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Accountability for Content</h2>\r\n\r\n		<p>OneUp shall be accountable for the content that it makes available. OneUp cannot be held accountable for offers from third-parties for which it only offers access (such as via links). OneUp cannot be held liable for any content on third-party webServices for which we offer links.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>Notification of Amendments to These Terms and Conditions</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Notification</h2>\r\n\r\n		<p>All declarations that are conducted within the context of the OneUp license agreement must be made in written form or via E-mail. The OneUp E-mail address is&nbsp;users@oneup.ng</p>\r\n		</li>\r\n		<li>\r\n		<h2>Revision of Terms and Conditions</h2>\r\n\r\n		<p>OneUp reserves the right to revise these terms and conditions at any time without reason. In such an event, OneUp will send an email containing the revised terms and conditions, or a notification containing a link to where they can be viewed on the Service before they come into effect. If a User does not expressly object to the validity of the new terms and conditions via E-mail within three days of being notified of the revision, then the newly revised terms and conditions will be considered agreed upon. If a User rejects the newly revised terms and conditions, then OneUp may terminate his license agreement in accordance with section 1.8.3.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>Severability</h2>\r\n\r\n	<p>If any section of these terms and agreements is deemed invalid, then the remaining sections will remain valid and enforceable. If this is the case, the most similar provision possible shall at OneUp&rsquo;s economic convenience replace the illegal, invalid, or unenforceable provisions thereby making it legal, valid and enforceable.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Applicable Law</h2>\r\n\r\n	<p>The laws of the Federal Republic of Nigeria govern these terms and conditions, and its courts shall have exclusive jurisdiction.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Areas of Use</h2>\r\n\r\n	<p>OneUp only offers its services in the countries that are stated expressly on the Service.</p>\r\n	</li>\r\n	<li>\r\n	<h2>Skill Games on the Internet</h2>\r\n\r\n	<p>Users are solely responsible for following all applicable laws in their country and/or state. In the event that a User acts illegally by using the Service in breach of local legislation, then no user contract shall take effect. If you are unsure of whether OneUp&#39;s services are legally permitted in your area, then seek legal advice before registration.</p>\r\n	</li>\r\n	<li>\r\n	<h1>Additional rules for Wager Mode Users</h1>\r\n	</li>\r\n	<li>\r\n	<h2>Registration</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Registration as a Money Player</h2>\r\n\r\n		<p>Participation in the Wager Mode requires submitting certain personal information, as well as purchasing Tokens.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Age Verification</h2>\r\n\r\n		<p>Only contractually capable, natural persons are allowed to participate in the Wager Mode. Persons under the age of eighteen (18) are not permitted to participate in the games of skill on the Service in which you have the chance to win Tokens from other Users. In order to comply with youth protection regulations, OneUp reserves the right to execute a verification of age exercise. Age verification can be automatically carried out during completion of registration, based on the information entered. If the registering individual is not in possession of a valid ID that was issued by the Federal Republic of Nigeria, then OneUp will do its best to determine another equally valid form of age verification.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Limitation of Participation</h2>\r\n\r\n		<p>Employees and staff members of OneUp and their associate companies are not eligible to participate in the Wager Mode. They may, however, participate in games for testing purposes, but without the intent to achieve any personal gain or profit.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>User Accounts</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Withdrawal</h2>\r\n\r\n		<p>Money Players are entitled to withdraw their account balance, or any portion of it, provided that the amount to be withdrawn is at least N1,000 or its equivalent in United States Dollars (where applicable) and the first withdrawal as a Money Player was at least six weeks prior to the current withdrawal. The requested withdrawal amount will be processed by OneUp and then transferred to the User&rsquo;s registered bank account, thus discharging OneUp&#39;s corresponding debt. Any incurred fees will be paid by the User. OneUp is not obligated to verify the authorization of the account holder. Bonus (such as first-deposit bonuses), payments that OneUp provides cannot be withdrawn. In cases such as these, the User will be notified that the corresponding funds cannot be withdrawn and can only be used exclusively for the purpose as originally intended.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Proof of Identity</h2>\r\n\r\n		<p>For security reasons, OneUp is authorized to withhold funds if it reasonably believe that the proof of identity provided by a User is false. In cases such as these, the User shall be obligated to send a verifiable copy of his personal ID Card, along with a written request to withdraw the funds, including his bank information.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Deletion of User Accounts</h2>\r\n\r\n		<p>User Accounts will be deleted at our sole discretion and without any notification of reason once a period of two (2) years has passed since the last login or when the contract is terminated. The OneUp service agreement shall be severed along with the deletion of the User&rsquo;s account. If the User replies with bank account information that does not deviate from what was previously submitted, then funds on the account in question, if any, will be transferred to the last bank account that was associated with that User&#39;s account. If a User&rsquo;s account is deleted, then OneUp shall reserve the right to withhold funds for the purpose of compensation for OneUp or third-parties, or as punishment for a breach of contract.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<h2>Fundamental Rules of Use and the Interdiction of Abuse</h2>\r\n\r\n	<ul>\r\n		<li>\r\n		<h2>Abuse</h2>\r\n\r\n		<p>Abusive behaviour on the Service is prohibited. Abuse behaviour includes, but is not limited to:</p>\r\n\r\n		<ul>\r\n			<li>\r\n			<p>purposely entering faulty, misleading, incorrect, or incomplete information;</p>\r\n			</li>\r\n			<li>\r\n			<p>opening multiple User Accounts or opening User accounts without proper authorization;</p>\r\n			</li>\r\n			<li>\r\n			<p>committing, or attempting to commit fraud, especially through the use of mechanisms, software, or any script in association with the Service that is intended to interrupt the functioning of the Service, help a user achieve better results than could be achieved through the sole use of their device screen, or negatively influence another User&#39;s game controls;</p>\r\n			</li>\r\n			<li>\r\n			<p>purposely causing an interruption or error in order to influence a game, such as to cause the game to prematurely end;</p>\r\n			</li>\r\n			<li>\r\n			<p>achieving or attempting to achieve an advantage over other Users through unfair behaviour of any kind, such as through deception, which could damage or endanger a fair competition;</p>\r\n			</li>\r\n			<li>\r\n			<p>cooperating with other Users in a way that could create an advantage over other users and thus diminish their opportunity for fair play and reduce their chances of winning</p>\r\n			</li>\r\n			<li>\r\n			<p>breaking any further rules or duties that are detailed in the general terms and conditions.</p>\r\n			</li>\r\n		</ul>\r\n		</li>\r\n		<li>\r\n		<h2>Rules for Communication</h2>\r\n\r\n		<p>It is possible for Users to contact each other, for reasons such as challenging each other to duels. In doing so, they are obligated to only send messages that:</p>\r\n\r\n		<ul>\r\n			<li>\r\n			<p>are free of obvious or hidden advertisement;</p>\r\n			</li>\r\n			<li>\r\n			<p>are neither subjective, intentionally false, derogatory, defamatory, immoral, nor pornographic in nature nor fulfil any other element of offense;</p>\r\n			</li>\r\n			<li>\r\n			<p>are not damaging to any third parties;</p>\r\n			</li>\r\n			<li>\r\n			<p>do not contain any viruses or computer programmes that could affect the function of external computers;</p>\r\n			</li>\r\n			<li>\r\n			<p>are not surveys or chain letters</p>\r\n			</li>\r\n			<li>\r\n			<p>were not written with the intent to expand a certain political, ideological, or religious denomination</p>\r\n			</li>\r\n			<li>\r\n			<p>were not written with the intent to collect, save, or use personal information from users without their explicit consent, especially for promotional purposes</p>\r\n			</li>\r\n		</ul>\r\n		</li>\r\n		<li>\r\n		<h2>Consequences of Abuse</h2>\r\n\r\n		<p>OneUp is authorized to close and/or delete User Accounts and end this contractual agreement without notice in cases of abusive behavior or the suspicion of abuse, especially those detailed in section 2.3.1 and 2.3.2. If this occurs, then games which have already begun will be aborted and the results will not be evaluated.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Measures against Abuse</h2>\r\n\r\n		<p>OneUp reserves the right to release information to legal courts and government agencies in the event of abusive content and statements. Furthermore, OneUp reserves the right to file a report with the police or any other law enforcement agency.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Reporting Problems</h2>\r\n\r\n		<p>All problems encountered during the use of our Services, including those with regard to games, User Accounts, can be reported to OneUp when the problem is encountered. OneUp deletes data after its use, and after ninety (90) days from when problems and errors can no longer be reviewed.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Posts/Comments</h2>\r\n\r\n		<p>OneUp is granted the unlimited right of usage in terms of space and time for all posts submitted on the OneUp user forum, or other information submitted to OneUp using the provided mechanisms for such including photographs, game comments and suggestions. The User is not entitled to compensation for such.</p>\r\n		</li>\r\n		<li>\r\n		<h2>Public Relations</h2>\r\n\r\n		<p>As a User in the Wager Mode, you consent to the use of your username, photographs and recordings to be displayed along with the amount of your winnings for the purpose of advertisement, press releases, release in printed media, radio, television, Internet, and otherwise be publicly made available, used, and duplicated.</p>\r\n\r\n		<p>Please direct all complaints, problems, and comments via E-mail at&nbsp;contact@oneup.ng.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '1', '2018-07-17 00:00:00', '2018-07-17 04:32:36'),
(5, 'Game Rules', 'game-rules', '<h2>4 TO SCORE GAME GOAL</h2>\r\n<p>The objective of this game is to line up four of your balls in a single row in any direction; horizontal, vertical or diagonal.</p>\r\n\r\n<h3>GENERAL GAME RULES</h3>\r\n<ul>\r\n	<li>The game computer randomly selects the player who goes first.</li>\r\n	<li>&nbsp;Each ball played drops vertically in the column selected by the player.</li>\r\n	<li>&nbsp;The first player to line up four of their balls in a row in any direction wins the game.</li>\r\n	<li>&nbsp;In the event all the available slots are filled with balls with neither player able to score, the match will considered a draw.</li>\r\n	<li>&nbsp;Each player has 30 seconds to make a move, failure to do so will result in the forfeiture of the turn and the opponent will be permitted to make their own move. Each player has 3 lives per game, and a loss is suffered by a player if they are the first to lose three turns in a game.</li>\r\n</ul>\r\n<br/>\r\n<h2>8-BALL POOL GAME GOAL</h2>\r\n<p>A player cannot sink the 8-ball until they have pocketed all of the appropriate balls (stripes or solids). The first player to legally pocket the 8-ball wins the game.</p>\r\n\r\n<h3>GENERAL GAME RULES</h3>\r\n<ul>\r\n	<li>The game computer randomly selects the player who goes first.</li>\r\n	<li>&nbsp;The choice of group is determined only when a player legally pockets an object ball after the break shot.</li>\r\n	<li>&nbsp;If a player pockets the opponent\'s ball, it remains down, however, if the shooter does not legally pocket one of his own group, they lose their turn.</li>\r\n	<li>&nbsp;Each player continues to shoot so long as they legally pocket any of their balls. Should a player fail to pocket their designated group ball, they shall lose their turn.</li>\r\n	<li>&nbsp;If a player fails to hit the 8-ball while shooting at it, it is a foul and the game continues.</li>\r\n	<li>&nbsp; A player will be deemed to have lost the game if they;\r\n	<br/>\r\n  * Pocket the 8-ball when it is not the legal object ball except on an opening break.\r\n  <br/>\r\n  * Pocket the 8-ball on the same stroke as the last of their group of balls.\r\n<br/>\r\n  * Pocket the 8-ball in a pocket other than the one designated.\r\n	</li>\r\n	<li>&nbsp;Each player has 30 seconds to make a move, failure to do so will result in the forfeiture of the turn and the opponent will be permitted to make their own move. Each player has 3 lives per game, and a loss is suffered by a player if they are the first to lose three turns in a game.\r\n	</li>\r\n</ul>\r\n<br/>\r\n<h2>CHESS GAME GOAL</h2>\r\n<p>White always makes the first move and each player takes turns alternately moving one piece at a time. If it is a player´s turn to move, they are not in check but have no legal moves, this situation is called “Stalemate” and it ends the game in a draw. Other draws include threefold repetition with the same position occurring three times with the same player to move, there are not enough pieces on the board to force a checkmate (example: a king and a bishop vs.a king) and the 50-move rule, where no pawn has been moved and no piece has been captured for 50 consecutive moves by each player.</p>\r\n\r\n<h3>GENERAL GAME RULES</h3>\r\n<ul>\r\n	<li>Checkmate occurs when a player\'s king is placed in check and there is no legal move to escape. Checkmate ends the game and the side whose king was checkmated loses.</li>\r\n	<li>&nbsp;Once during the game the King may perform a move known as Castling. In Castling, the King is moved TWO squares to the Right or Left, as the case may be, and the Rook towards which the King has moved is then placed upon the square which the King jumped over. But this move is not permitted when:\r\n		<br/><br/>\r\n		1. The King is in \"Check,\" i.e., menaced with capture.<br/>\r\n		2. The King or Rook has already made a move.<br/>\r\n		3. The move of the Rook is obstructed.<br/>\r\n		4. The King or Rook after Castling would be exposed to capture.<br/>\r\n	</li>\r\n	<li>&nbsp;Each player has 30 seconds to make a move, failure to do so will result in the forfeiture of the turn and the opponent will be permitted to make their own move. Each player has 3 lives per game, and a loss is suffered by a player if they are the first to lose three turns in a game.</li>\r\n</ul>\r\n\r\n<br/>\r\n\r\n<h2>DRAUGHTS GAME GOAL</h2>\r\n<p>The objective of the draughts game is to take all of the opponent\'s pieces or to produce a position such that the opponent is unable to move any of their pieces.</p>\r\n\r\n<h3>GENERAL GAME RULES</h3>\r\n<ul>\r\n	<li> The player with the lighter pieces moves first. Then turns alternate.</li>\r\n\r\n <li> Ordinary(uncrowned) pieces move one square diagonally forward to an unoccupied square.</li>\r\n\r\n <li> Enemy pieces can, and must be captured by jumping over the enemy piece, two squares forward to an unoccupied square immediately beyond. If a jump is possible it must be done, even if doing so incurs a disadvantage for the player making the move.</li>\r\n\r\n <li> Multiple successive jumps forward in a single turn can and must be made if after each jump there is an unoccupied square immediately beyond the enemy piece. It is mandatory to jump over as many pieces as possible.</li>\r\n\r\n <li> The same piece may not be jumped more than once.</li>\r\n\r\n <li> A piece is crowned if it stops on the far edge of the board at the end of its turn. The piece is starred to mark it. Crowned pieces can move in any direction and may jump over, and hence capture an opponent piece some distance away and choose where to stop afterwards, but must still capture the maximum number of pieces possible.</li>\r\n\r\n <li> A player with no valid move remaining loses. This occurs if the player has no pieces left, or if all the player\'s pieces are obstructed from moving by opponent pieces.</li>\r\n\r\n <li> A game will end in a draw if neither player has the possibility to win the game.</li>\r\n\r\n <li> The game is considered a draw when the same position repeats itself three times (not necessarily consecutive), with the same player having the move each time.</li>\r\n\r\n <li> A one king against one king endgame is automatically declared a draw.</li>\r\n\r\n <li> Each player has 30 seconds to make a move, failure to do so will result in the forfeiture of the turn and the opponent will be permitted to make their own move. Each player has 3 lives per game, and a loss is suffered by a player if they are the first to lose three turns in a game.</li>\r\n</ul>\r\n<br/>\r\n<h2>WHOT GAME GOAL</h2>\r\n<p>In the WHOT game, each player competes to be the first to get rid of the cards in their deck by following number or card shape. The shapes are called circle, triangle, cross, square, and star..</p>\r\n\r\n<h3>GENERAL GAME RULES</h3>\r\n<ul>\r\n	 <li> The game computer randomly selects the player who goes first.</li>\r\n\r\n <li> The game computer deals 6 cards to each player, one at a time, and the rest of the pack is placed face down to form a draw pile.</li>\r\n\r\n <li> The player selected to go first begins by playing any card from their hand to start a play pile.</li>\r\n\r\n <li> When the previous play was a card of one of the five shapes, the possible plays are; any card with the same shape as the previous play, any card with the same number as the previous play, any WHOT card, when a WHOT card is played, the player must name a shape. The next card played must be a card of the named shape or another Whot card.</li>\r\n\r\n<li> If a player cannot or does not wish to play a card at their turn, they draw one card from the draw pile instead; having drawn a card, they are not allowed to play a card on this turn.</li>\r\n\r\n <li>If the draw pile runs out, all except the top card of the play pile are shuffled to form a new draw pile, and play continues.</li>\r\n\r\n<li> Specific card numbers trigger actions in the game. These cards are detailed below;\r\n	<br/><br/>\r\n  * Card number - 1. Action - Hold on. Definition - The same player plays again.<br/>\r\n  * Card number - 2. Action - Pick two. Definition - The opponent must either play another two, or must draw two cards from the pile instead.<br/>\r\n  * Card number - 5. Action - Pick three. Definition - The opponent must either play another five or must draw three cards from the stock instead.<br/>\r\n  * Card number - 8. Action - Hold on. Definition - The same player plays again.<br/>\r\n  * Card number - 14. Action - General market. Definition - The opponent must immediately draw one card from the stock.<br/></li>\r\n\r\n<li> Each player has 30 seconds to make a move, failure to do so will result in the forfeiture of the turn and the opponent will be permitted to make their own move. Each player has 3 lives per game, and a loss is suffered by a player if they are the first to lose three turns in a game.</li>\r\n</ul>\r\n\r\n<br/>\r\n<h2>WORD WARS GAME GOAL</h2>\r\n<p>The objective of the Word Wars game is to have the highest number of points at the end of the game, when all the tiles in the bag run out, and one player doesn\'t have any tiles left in their rack.</p>\r\n\r\n<h3>GENERAL GAME RULES</h3>\r\n<ul>\r\n <li> The game computer randomly selects the player who goes first.</li>\r\n\r\n <li> Each player gets 8 random tiles on their rack.</li>\r\n\r\n <li> The first player combines two or more of their letters to form an English word and plays it on the board to read either horizontally or vertically with one letter on the center square. Diagonal words are not permitted.</li>\r\n\r\n<li> New words may be formed by; adding one or more letters to a word already on the board, placing a word at right angles to a word already on the board (the new word must use one of the letters already on the board or must add a letter to it), placing a complete word parallel to a word already played so that adjacent letters also form complete words.</li>\r\n\r\n <li> No tile may be shifted or replaced after it has been played and scored.</li>\r\n\r\n <li> Blank tiles may be used as any letter in the alphabet. When playing a blank, you will be prompted to state the letter it is representing. It remains that letter for the rest of the game.</li>\r\n\r\n <li> Each player may use a turn to exchange all, or some of their tiles. There is no limit to the number of times a player can perform this action.</li>\r\n\r\n <li> The game ends when all letters have been drawn and one player uses his or her last letter; or when all possible plays have been made.</li>\r\n\r\n<li> Words that are not in the English dictionary are invalid and cannot be played.</li>\r\n\r\n <li>Each player has 30 seconds to make a move, failure to do so will result in the forfeiture of the turn and the opponent will be permitted to make their own move. Each player has 3 lives per game, and a loss is suffered by a player if they are the first to lose three turns in a game.</li>\r\n</ul>', '1', '2018-07-17 00:00:00', '2018-07-17 04:32:36'),
(6, 'Responsible Gaming', 'responsible-gaming', '<p><strong>Responsible Gaming</strong></p>\r\n\r\n<p>OneUp is dedicated to providing its Users with a responsible gaming environment. Not only is it our mission to provide Users with the most entertaining gaming experience, but it is also our duty to help prevent compulsive usage of, and underage access to our gaming products.</p>\r\n\r\n<p>The enjoyment of our players is OneUp&rsquo;s highest priority. For us, the high quality of our games, as well as player trust in OneUp as a fair provider of games, is of utmost importance. Similar to other forms of entertainment, such as television and sports, games should be enjoyed in moderation so that fun is always the focus.</p>\r\n\r\n<p>As a responsible, regulated gaming company, we comply with all guidelines published by the National Lottery Regulatory Commission.</p>\r\n\r\n<p>We have implemented the following company policies and tools:</p>\r\n\r\n<p><strong>Protection of minors</strong>&nbsp;</p>\r\n\r\n<p>In line with International Best Practices, OneUp ensures that only people of legal age use our services. We use sophisticated verification systems that can identify minors who log in to our service. We are aware that the legal age for gaming online varies in different jurisdictions and advise that you check the rules applicable to you before playing.</p>\r\n\r\n<p>We recognise that the Internet is readily accessible in many homes around the world and as such, gaming companies and parents must work together to protect children from underage gambling. To ensure the safety of your children, we recommend installing filtering software to block minors from accessing certain websites and programmes.</p>\r\n\r\n<p>Below are links to some such providers and software:</p>\r\n\r\n<p><a href=\"http://www.cyberpatrol.com/\" target=\"_blank\">Cyber Patrol</a>&nbsp;</p>\r\n\r\n<p><a href=\"http://www.gamblock.com/index.html\" target=\"_blank\">GamBlock</a>&nbsp;<br />\r\n<a href=\"http://www.netnanny.com/\" target=\"_blank\">Net Nanny</a>&nbsp;<br />\r\n<a href=\"https://gamban.com/\" target=\"_blank\">Gamban</a>&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Tips for parents:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Do not leave children unattended near your device when you have logged into the Site. You must take special care to ensure that they do not access our services via your devices.</p>\r\n	</li>\r\n	<li>\r\n	<p>Protect your login details with password access.</p>\r\n	</li>\r\n	<li>\r\n	<p>Do not allow persons under 18 to participate in any gambling activity.</p>\r\n	</li>\r\n	<li>\r\n	<p>Keep your username, password and deposit method details out of the reach of children.</p>\r\n	</li>\r\n	<li>\r\n	<p>Educate your children about the legality and the potential damage of underage gambling.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Unfortunately, no system is fool proof. If you know a person under the age of 18 who is registered with us, please notify us at&nbsp;<a href=\"mailto:contact@oneup.ng\">contact@oneup.ng</a></p>\r\n\r\n<p><strong>Preventing Compulsive Gambling</strong></p>\r\n\r\n<p>OneUp recognises that while most people gamble for entertainment, a small number of people can become obsessed with the potential monetary gains our games offer. Even though studies suggest that only a very small percentage of the adult population encounters compulsive gambling problems we take this matter very seriously and have accordingly implemented a number of measures to address this problem:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>OneUp&rsquo;s training program incorporates methods and techniques that assist our employees in recognizing and taking appropriate actions when they identify compulsive or underage gambling.</p>\r\n	</li>\r\n	<li>\r\n	<p>We have implemented an easy way to use our self-exclusion program for those who may need our assistance. Upon your request, we will cancel your membership and will prevent you from accessing the Wager Modes.</p>\r\n	</li>\r\n	<li>\r\n	<p>Upon your request, we will remove your name from our email list.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p><strong>Remember</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Gambling is a form of entertainment. It is not a way to get rich quickly and pay off your debts.</p>\r\n	</li>\r\n	<li>\r\n	<p>Gambling is a game of chance. There are no formulas that guarantee winnings.</p>\r\n	</li>\r\n	<li>\r\n	<p>Make sure that the decision to gamble is your choice.</p>\r\n	</li>\r\n	<li>\r\n	<p>Never try to chase your losses.</p>\r\n	</li>\r\n	<li>\r\n	<p>Check the amounts you spend on a regular basis.</p>\r\n	</li>\r\n	<li>\r\n	<p>Make sure you know the rules of the games you play.</p>\r\n	</li>\r\n	<li>\r\n	<p>Like many things, what is enjoyable in moderation can be disastrous in excess.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Advice and Help</strong></p>\r\n\r\n<p>You may seek professional help from the following organisations:</p>\r\n\r\n<p><a href=\"http://www.gamblersanonymous.org/\" target=\"_blank\">Gamblers Anonymous</a>&nbsp;<br />\r\n<a href=\"http://www.ncpgambling.org/\" target=\"_blank\">National Council on Problem Gambling</a>&nbsp;<br />\r\n<a href=\"http://www.gamblingtherapy.org/?ReferrerID=311\" target=\"_blank\">Gambling Therapy Helpline</a></p>\r\n', '1', '2018-07-17 00:00:00', '2018-07-17 04:31:26'),
(7, 'About OneUp', 'about-oneup', '<p>At OneUp, we make fun profitable by providing a multiplayer gaming platform that enables users combine the excitement of playing their favourite board games with the ability to make money while doing so from anywhere in the world. We&rsquo;re very passionate about sharing the games we&rsquo;ve enjoyed since we were children, and we&rsquo;re excited to be contributing to the longevity of our culture in our own way.</p>\r\n\r\n<p><br />\r\nOneUp is a proudly Nigerian brand operated by M-Vanadium Core Nigeria Limited under license from the National Lottery Regulatory Commission.</p>\r\n', '1', '2018-07-17 00:00:00', '2018-07-17 04:31:26');
INSERT INTO `pages` (`id`, `page_title`, `slug`, `page_content`, `status`, `created_at`, `updated_at`) VALUES
(8, 'Game Tips', 'game-tips', '<p>We want you to have the best experience on OneUp and would like to share some suggestions  aimed ensuring you achieve this every time you log on to the platform</p>\r\n\r\n<ul>\r\n	<li>Please ensure you are comfortably in control of your device, and you are not being jostled. Minor disruptions can affect your concentration and performance in games.</li>\r\n	<li>&nbsp;Playing wager mode and a call comes in? Prolonged loss of connection from the game server will see you forfeit the match. If the incoming call is not urgent, you might want to terminate it and get back to the caller when you are through with your match.</li>\r\n	<li>&nbsp;Mentally tired from playing too many games? Take a break! Stretch your legs, get a drink, read a book, and come back refreshed to get some Ws (and tokens!) under your belt!</li>\r\n	<li>&nbsp;Practice! Practice! Practice! The offline modes allow you to hone your skills against the AI without losing precious tokens. Dive back into the wager mode when you feel sufficiently ready to hand out Ls to other users.</li>\r\n	<li>&nbsp;Set a token limit and stick to it. How many tokens are you willing to win or lose in a day? Understand this number to avoid chasing losses.</li>\r\n	<li>&nbsp;You&#39;ve won a pile of tokens and they are sitting in your wallet? Whatever for? Use the &#39;sell tokens&#39; option to cash out and send the money direct to your bank account!</li>\r\n	<li>&nbsp;Exiting a match mid-game will earn you a straight loss... Don&#39;t do that! Keep at it till the end, there&#39;s nothing like snatching a victory from the jaws of defeat! We promise!</li>\r\n</ul>\r\n', '1', '2018-07-17 00:00:00', '2018-07-17 04:32:36');
